import React, { Component } from 'react';
import { MDBContainer } from 'mdbreact';

import { Consumer } from '../../context';

class MostPopularMovies extends Component {
  render() {
    return (
      <Consumer>
        {value => {
          console.log(value);
          <h1>Top</h1>
        }}
      </Consumer>
    );
  }  
}

export default MostPopularMovies;
